const std::string GetCurrentDateTime()
{
	time_t     now = time(0);
	struct tm  tstruct;
	char       buf[80];
	tstruct = *localtime(&now);
	strftime(buf, sizeof(buf), "%X", &tstruct);

	return buf;
}

void c_menu::DrawWatermark()
{
	if (!vars.visuals.watermark)
		return;

	int x, y;
	interfaces.engine->GetScreenSize(x, y);
	std::stringstream ss;

	static auto framerate = 0.0f;
	framerate = framerate * 0.9f + interfaces.global_vars->frametime * 0.1f;
	auto fps = std::to_string((int)(std::clamp(1.0f / framerate, 0.0f, 999.0f)));

	int rate = (int)std::round(1.f / interfaces.global_vars->interval_per_tick);

	auto net_channel = interfaces.engine->GetNetChannelInfo();
	auto local_player = csgo->local;
	std::string outgoing = local_player ? std::to_string((int)(net_channel->GetLatency(FLOW_OUTGOING) * 1000)) : "0";

	ss << "PA1N-CHEATS [Alpha] | " << rate << " tick" << " | " << fps << " fps" << " | " << GetCurrentDateTime().c_str();

	auto textsize = Drawing::GetStringWidth(fonts::esp_name, ss.str().c_str());
	g_Render->FilledRect(x - 320, 6, textsize + 15, 17, color_t(35,35,35));
	g_Render->FilledRect(x - 320, 6, textsize + 15, 2, vars.visuals.watermark_color);

	g_Render->DrawString(x - 310, 8, color_t(255, 255, 255, 255), render::outline, fonts::menu_main, ss.str().c_str()); //Sz�veg

}




